import React, { FunctionComponent, useState } from "react";
import { TemplateProps } from "@govtechsg/decentralized-renderer-react-components";
import { v3 } from "@govtechsg/open-attestation";

import Handlebars from "handlebars";

export interface PostalAddress {
  line1: string;
  line2?: string;
  cityName: string;
  postcode: string;
  countrySubDivisionName?: string;
  countryCode: string;
}
export interface Entity {
  iD: string;
  name: string;
  postalAddress: PostalAddress;
}
export interface Consignments {
  iD: string;
  information: string;
  crossBorderRegulatoryProcedure: {
    originCriteriaText: string;
  };
  manufacturer: {
    iD: string;
    name: string;
    postalAddress: PostalAddress;
  };
  tradeLineItems: TradeLineItems[];
}
export interface TradeLineItems {
  sequenceNumber: number;
  invoiceReference: {
    iD: string;
    formattedIssueDateTime?: string;
    issueDateTime?: string;
    attachedBinaryFile: {
      uRI: string;
    };
  };
  tradeProduct: {
    iD: string;
    description: string;
    harmonisedTariffCode: {
      classCode: string;
      className: string;
    };
    originCountry: {
      code: string;
    };
  };
  transportPackages: {
    iD: string;
    grossVolume: string;
    grossWeight: string;
  }[];
}
export interface CITESPermitDoc extends v3.OpenAttestationDocument {
  render: string;
  credentialSubject: {
    iD: string;
    issueDateTime: string;
    name?: string;
    firstSignatoryAuthentication: {
      signature: string;
      actualDateTime: string;
    };
    secondSignatoryAuthentication: {
      signature: string;
      actualDateTime: string;
    };
    isPreferential?: boolean;
    supplyChainConsignment: {
      iD: string;
      information: string;
      exportCountry: {
        code?: string;
        name?: string;
      };
      consignor: Entity;
      importCountry: {
        code?: string;
        name?: string;
      };
      consignee: Entity;
      includedConsignmentItems: Consignments[];
      loadingBaseportLocation: {
        iD: string;
        name: string;
      };
      mainCarriageTransportMovement: {
        iD: string;
        information: string;
        usedTransportMeans: {
          iD: string;
          name: string;
        };
        departureEvent: {
          departureDateTime: string;
        };
      };
      unloadingBaseportLocation: {
        iD: string;
        name: string;
      };
    };
    links?: {
      self?: {
        href?: string;
      };
    };
  };
}
interface ConsinmentRenderItem {
  ItemNumber?: number;
  Marks?: string;
  Kinds?: string;
  Origin?: string;
  Quantity?: string;
  InvoiceNum?: string;
  InvoiceDate?: string;
}

export const CITESPermit: FunctionComponent<TemplateProps<CITESPermitDoc>> = ({ document }) => {
  const permitData = document?.credentialSubject;
  const rendererSource =
    "";
  const source = atob(rendererSource);
  const template = Handlebars.compile(source);
  const data = {
    importer: `Luis Vuitton`,
    exporter: "Crazy Craig%27s Crocodile Clutches",
    importing_country: "Switzerland",
    special_conditions: "Craig must acquit his permit somehow...",
    valid_until: "01/01/2023",
    management_authority: "Australian CITES Management Authority",
    purpose: "Commercial",
    security_stamp_no: "ABD3456",
    scientific_name: "Crocodylus porosus",
    description: "Clutches (LPS)",
    appendix: "II",
    quantity: "123",
    issued_by: "DCCEEW",
    issue_date: "15/11/2022",
    permit_no: "2022-AU-123456789",
  };
  const svg = template(data);
  return (
    <div>
      <img src={`data:image/svg+xml;utf8,${svg}`} style={{ width: "80%", height: "auto", textAlign: "center" }} />
    </div>
  );
};
